private static StorageType[] toStorageTypes(List<?> list) {
  if (list == null) {
    return null;
  } else {
    StorageType[] storageTypes = new StorageType[list.size()];
    for (int i = 0; i < list.size(); i++) {
      storageTypes[i] = StorageType.parseStorageType((String) list.get(i));
    }
    return storageTypes;
  }
}
